package health

import (
	"sync/atomic"
	"time"
)

type Metrics struct {
	requestCount  uint64
	errorCount    uint64
	totalLatency  uint64
}

func (m *Metrics) RecordRequest(latency time.Duration, isError bool) {
	atomic.AddUint64(&m.requestCount, 1)
	atomic.AddUint64(&m.totalLatency, uint64(latency.Milliseconds()))
	if isError {
		atomic.AddUint64(&m.errorCount, 1)
	}
}

func (m *Metrics) GetStats() (requests, errors, avgLatency uint64) {
	requests = atomic.LoadUint64(&m.requestCount)
	errors = atomic.LoadUint64(&m.errorCount)
	if requests > 0 {
		avgLatency = atomic.LoadUint64(&m.totalLatency) / requests
	}
	return
}

